import React, { Component } from "react";
// import "./Logo.css";

export class Logo extends Component {
  render() {
    return (
      <div
        className="container"
        style={{
          height: "70px",
          width: "70px",
          border: "2px solid white",
          position: "absolute",
          display: "flex",
          alignItems: "center",
          justifyContent: "center"
        }}
      >
        <div className="cicle">
          <div />
          <div />
          <div />
        </div>
      </div>
    );
  }
}

export default Logo;
